import React from 'react';
import './App.css';
import CompletedCourse from './CompleCourse';
import Course from './Course';

class CompletedCourseArea extends React.Component {
  getCourses() {
    console.log("load")
    console.log(this.props.compleCourses.length)
    console.log(this.props.compleCourses.data)

    let courses = [];

    for (const course of Object.values(this.props.courses)) {
      // search
      courses.push(
        <Course key={course.name} data={course} courseCallback={this.props.addCourse} subSectionCallbackPass2={this.props.addSubSection} sectionCallbackPass={this.props.addSection} cartMode={this.props.cartMode} />
      )

    }

    return courses;
  }

  render() {
    return (
      <React.Fragment>
<div class="h-100">
          <h3><strong>Course Cart</strong></h3>
          <h3 style={{display: this.props.compleCourses.length ? "none":"block"}}> No courses/sections/subsections added yet. <br></br> Go to "Seach" to add them!</h3>
          {this.getCourses()}
        </div>
      </React.Fragment>
    );
  }
}

export default CompletedCourseArea;
